      "slug" : [ "eeuu", "elecciones", "disturbios", "armas", "distribución" ],
      "news" : [ "Los hipermercados estadounidenses Walmart decidieron el viernes volver a poner las armas de fuego y las municiones en sus estanterías, un día después de retirarlas a raíz de las violentas protestas en Filadelfia y a pocos días de unas tensas elecciones presidenciales.", "Las manifestaciones que siguieron a la muerte de un hombre negro a manos de la policía en Filadelfia derivaron en disturbios el miércoles, que terminaron con varias detenciones. ", "Como ya había hecho este verano durante las protestas que siguieron a la muerte de George Floyd, un afroestadounidense asesinado por la policía, el grupo decidió nuevamente poner a resguardo las armas de fuego y municiones que vende en cerca de la mitad de sus tiendas. ", "Ambas decisiones, la de quitar las armas del alcance del público y la de volver a colocarlas, se producen unos días antes de las presidenciales del próximo martes. ", "En el centro de Washington, muchos edificios comenzaron el miércoles a proteger puertas y ventanas con planchas de contrachapado en previsión de posibles manifestaciones tras la jornada electoral.", "..." ],
